create sequence dbo.seq_ipr
    as integer
    start with 580;

create table ipr
(
    id            bigint default (nextval('dbo.seq_ipr'::regclass))::regclass not null
        constraint ipr_pk
            primary key,
    code          varchar(50),
    protocol_code varchar(50),
    name          varchar(100),
    campaign_id   bigint                                                      not null
        constraint ipr_campaign_id_fk
            references campaign,
    protocol_id   bigint
        constraint ipr_protocol_campaign_id_fk
            references protocol_campaign,
    created_at    timestamp,
    updated_at    timestamp,
    created_by    bigint,
    updated_by    integer,
    id_state      integer
);

alter table ipr
    owner to gesco;

